import React, { useState } from "react";

/* External API */
import FadeIn from "react-fade-in";

/* Internal API */
import { CSVProcessor } from "../../api/processors/CSVProcessor";
import { UserQuestions } from "../../api/processors/QuestionnaireProcessor";

/* UI Components */
import Button from "../components/Button";
import Input from "../components/Input"

/* Styles */
import './AdminScreen.scss';


export default function AdminScreen(props) {

  const [sentSMSCode, toggleSentSMSCode] = useState(false);
  const [smsCode, updateSMSCode] = useState("");
  /* Analist token */
  const [analistToken, setAnalistToken] = useState("");
  const [analistMessage, setAnalistMessage] = useState(undefined);
  /* UserIDs */
  const [userIdsMessage, setUserIdsMessage] = useState(undefined);
  const [fetchCount, updateFetchCount] = useState(0);
  const [activeCount, updateActiveCount] = useState(0);
  /* Fetched Data */
  const [userIds, setUserIds] = useState([]);
  const [userQuestionnaires, setUserQuestionnaires] = useState([])
  const [fitBitData, setFitBitData] = useState("");

  /* Data retrieval functions */
  async function getAnalistToken() {
    const result = await Meteor.callPromise('getAnalistToken', {smsCode: smsCode});
    updateSMSCode("");
    toggleSentSMSCode(false);
    if (result.statusCode === 200 || result.response?.statusCode === 200) {
      setAnalistToken(result.headers.authorization.split(" ")[1]);
      setAnalistMessage({status:"success", message: "Analist-token succesvol opgehaald!"});
    }
    else {
      const statusCode = result.response?.statusCode ? result.response?.statusCode : result.statusCode;
      setAnalistMessage({status:"error", message: `Fout bij het ophalen van code [Error ${statusCode}]`});
    }
  }

  async function getUserData() {
    const result = await Meteor.callPromise('getUserIds', {analistToken: analistToken});
    if (result.statusCode === 200 || result.response?.statusCode === 200) {
      setUserIdsMessage({status:"success", message: `GebruikerIDs succesvol opgehaald! Aantal gebruikers: ${result.data.length}`});
      setUserIds(result.data);
    }
    else {
      const statusCode = result.response?.statusCode ? result.response?.statusCode : result.statusCode;
      setUserIdsMessage({status:"error", message: `Fout bij het ophalen van gebruikerIDs [Error ${statusCode}]`});
    }
  }

  /* USER DATA */ 
  async function fetchUserData(totalSize, steps) {
    let data = [];
    for (let i = userIds.length - totalSize; i < userIds.length; i += steps) {
      const upperBound = i + steps > userIds.length ? userIds.length : i + steps;
      await fetchUserDataChunk(i, upperBound).then(( res ) => data = [...data, ...res.map(user => user.value)]);
    }
    setUserQuestionnaires(data);
    console.log(data);
    return data;
  }

  async function fetchUserTestData() {
    const data = await Meteor.callPromise('getUserData', {userId: 2618594, analistToken: analistToken}).then((result) => {
      console.log(`Done for user`); 
      updateFetchCount(prevState => (prevState+1)); 
      updateActiveCount(prevState => (prevState-1));
      return new UserQuestions(result.data)
        .parseUserQuestions()
        .groupUserQuestions()
        .tagUserQuestions(2618594, 2618594)
        .result})
    console.log(data);
    setUserQuestionnaires([data]);
    return data;
  }

  async function fetchUserDataChunk(from, to) {
    const userIdSlice = userIds.slice(from, to)
    const fetchPromises = [];
    for (const user of userIdSlice) {
      updateActiveCount(prevState => (prevState+1));
      fetchPromises.push(Meteor.callPromise('getUserData', {userId: user.gebruikerId, analistToken: analistToken})
        .then((result) => {
          console.log(`Done for user ${user.gebruikerId}`); 
          updateFetchCount(prevState => (prevState+1)); 
          updateActiveCount(prevState => (prevState-1));
          return new UserQuestions(result.data)
            .parseUserQuestions()
            .groupUserQuestions()
            .tagUserQuestions(user.gebruikerId, user.rrnr)
            .result})
        .catch(error => console.error(error)))
    }
    return Promise.allSettled(fetchPromises);
  }

    /* FITBIT DATA */
    async function fetchFitBitData(totalSize, steps) {
      let data = [];
      for (let i = 0; i < totalSize; i += steps) {
        const upperBound = i + steps > userIds.length ? userIds.length : i + steps;
        await fetchFitBitDataChunk(i, upperBound).then(( res ) => data = [...data, ...res.map(user => user.value)]);
      }
      setFitBitData(data);
      return data;
    }
  
    async function fetchFitBitDataChunk(from, to) {
      const userIdSlice = userIds.slice(from, to)
      const fetchPromises = [];
      for (const user of userIdSlice) {
        updateActiveCount(prevState => (prevState+1));
        fetchPromises.push(Meteor.callPromise('getFitBitData', {userId: user.gebruikerId, analistToken: analistToken})
          .then((result) => {
            console.log(`Done for user ${user.gebruikerId}`); 
            updateFetchCount(prevState => (prevState+1)); 
            updateActiveCount(prevState => (prevState-1));
            setFitBitData(prevState => (prevState + result.data));
          })
          .catch(error => console.error(error)))
      }
      return Promise.allSettled(fetchPromises);
    }

  function downloadCSV(file) {
    console.log(userQuestionnaires)
    var blob = new Blob([file], { type: "csv" });
    var a = window.document.createElement("a");
    a.href = window.URL.createObjectURL(blob, {  type: "data:attachment/xlsx" });
    a.download = 'data.csv';
    document.body.appendChild(a);
    a.click();
    document.body.removeChild(a);
  }

  /* Render functions */
  function renderStepOne() {
    return (<React.Fragment>
      <h3>Stap 1: Vraag SMS code op</h3>
        <p style={{maxWidth:"500px"}}>Vraag eerst een SMS code op. Deze zal gebruikt worden om een data-analist token op te halen zodat je de gebruikergegevens op kan vragen.</p>
        <Button width="300px" disabled={sentSMSCode} color="blue" center onClick={() => { Meteor.call('getSMSCode'); toggleSentSMSCode(true) }}>{ sentSMSCode ? "Verstuurd" : "Stuur SMS code"}</Button>
    </React.Fragment>)
  }

  function renderStepTwo() {
    return (<React.Fragment>
      <h3>Stap 2: Vul je SMS code in</h3>
        <p style={{maxWidth:"500px"}}>Je zou nu een SMS code moeten ontvangen op nummer +32 473 55 70 38. Vul deze code in om de data-analist token op te halen.</p>
        <div style={{display: "flex", flexDirection:"row", maxWidth:"300px"}}>
          <Input type="text" style={{flex: 2}} placeholder="Vul SMS code in" onChange={updateSMSCode}/>
          <Button width="fit" style={{marginTop: "10px", marginBottom: "10px"}} color="blue" center onClick={() => getAnalistToken() }>Verstuur</Button>
        </div>
        {analistMessage && <p className={analistMessage.status}>{analistMessage.message}</p>}
    </React.Fragment>)
  }

  function renderStepThree() {
    return (<React.Fragment>
      <h3>Stap 3: Haal gebruikergegevens op</h3>
        <p style={{maxWidth:"500px"}}>Je kan nu alle gebruikergegevens ophalen.</p>
        <Button width="300px" color="blue" center onClick={() => getUserData() }>Haal gegevens op</Button>
        <Button width="300px" color="blue" center onClick={() => fetchFitBitData(userIds.length, 10) }>Haal fitbit op</Button>
        {userIdsMessage && <p className={userIdsMessage.status}>{userIdsMessage.message}</p>}
        {userIds.length > 0 && <Button width="300px" color="blue" center onClick={() => fetchUserData(userIds.length, 10) }>Verwerk gebruikers</Button>}
        {userIds.length > 0 && fetchCount < userIds.length && <p className="info">Data opgehaald van {fetchCount} van {userIds.length} gebruikers.</p>}
        {userIds.length > 0 && fetchCount < userIds.length && <p className="info">Momenteel aan het pollen: {activeCount}.</p>}
        {userIds.length > 0 && fetchCount === userIds.length && <p className="success">Data opgehaald van alle {userIds.length} gebruikers!</p>}
    </React.Fragment>)
  }

  function renderTest() {
    return (<React.Fragment>
      <h3>Test</h3>
        <p style={{maxWidth:"500px"}}>Test hier je functie</p>
        <Button width="300px" color="blue" center onClick={() => {
          let csv = new CSVProcessor(userQuestionnaires);
          //let csv = new CSVProcessor(JSON.parse(exampleLog));
          csv.createHeader().addAllUsers();
          downloadCSV(csv.csv);
        }}>Test</Button>
    </React.Fragment>)
  }

  return (<div className="control-panel">
      <h1>MyCoach - Settings</h1>
      <div style={{display: "flex", flexDirection: "column", gap: "10px"}}>
        <FadeIn>
        { renderStepOne() }
        { renderStepTwo() }
        { renderStepThree() }
        { renderTest() }
        </FadeIn>
      </div>
    </div>)
}




